CREATE SCHEMA `crypto_market` ;

CREATE TABLE `crypto_market`.`users_table` (
  `user_id` INT NOT NULL AUTO_INCREMENT,
  `user_name` VARCHAR(45) NOT NULL,
  `balance` DOUBLE NOT NULL DEFAULT 0,
  `tier` INT NOT NULL DEFAULT 5,
  PRIMARY KEY (`user_id`));
  

CREATE TABLE `crypto_market`.`trades_table` (
  `trade_id` INT NOT NULL AUTO_INCREMENT,
  `trade_user_id` INT NOT NULL,
  `amount` DOUBLE NOT NULL,
  `op_price` DOUBLE NOT NULL,
  `clos_price` DOUBLE NOT NULL,
  PRIMARY KEY (`trade_id`));

